import React from "react";
import "./HealthCard.css";

const Health = () => {
  return (
    <div className="health">
      <div className="container">
        <div className="icon">
          <i
            class="fa-solid fa-heart"></i>
            style={{ color: "#E4EAF3", fontSize: "1.5rem" }}
          />
        </div>
        <p>Health</p>
      </div>
    </div>
  );
};

export default Health;
